import styled from 'styled-components'

const Container = styled.div`
display
  width: auto;
  background-color: #30d158;
  border-radius: 5px;
  color: #fff;
  font-size: 18px;
  font-weight: 600;
  height: 50px;
  padding: 0 1.5rem;
  text-align: center;
  align-items: center;
`

export const WordListItem = ({ item }) => <Container>{item}</Container>
